import React from 'react'
import "./Portfolio.scss"

export default function Portfolio() {
  return (
    <div className='portfolio' id='portfolio'>
    <div className='slider'>
      
        <div className='item'>
        <img src="/assets/image1.jpg" alt='DP'></img>

        </div>
      
    </div>

      
    </div>
  )
}
